    "d8a6202b-c0c3-463d-88a0-3bc021a178ed",ntt"name": "nasa-gov"nt},nt"relationships_as_subject":
    [],nt"num_tags": 3,nt"name": "high-frequency-measurements-in-shock-wave-turbulent-boundary-layer-interaction-at-duplicat-71871",nt"isopen":
    true,nt"url": null,nt"notes": "Large amplitude, unsteady heating loads
    and steep flow gradients produced in regions of shock-wave/turbulent boundary-layer
    interaction (SWTBLI) pose a serious and challenging problem for designers of hypersonic
    vehicles. Characterizing SWTBLI flow features, such as the size of flow separation,
    is important for design evaluation and CFD validation. Tao Systems and CUBRC propose
    to develop a wide-bandwidth, thin-film heat transfer sensor system that quantifies
    the high frequency SWTBLI at duplicated flight conditions. This effort combines
    Tao Systems' high frequency-response/high-sensitivity electronics and signal processing
    techniques with the unique expertise of CUBRC in high-speed, high-enthalpy flows
    to obtain spatiotemporal information for the development of physics-based turbulence
    models.",nt"owner_org": "d8a6202b-c0c3-463d-88a0-3bc021a178ed",nt"extras":
